import { useState } from 'react';
import { NavLink, useLocation } from 'react-router-dom';
import Foto from '../assets/img/logo.png';

function Header() {
	const location = useLocation();
	const [isMenuOpen, setMenuOpen] = useState(false);

	const isNavLinkActive = (path) => {
		return location.pathname === path;
	};

	const toggleMenu = () => {
		setMenuOpen(!isMenuOpen);
	};

	return (
	 <header className="fixed w-full top-0 z-50">
		 <nav className="bg-gray-100 py-3 header">
			 <div className="flex items-center justify-center flex-wrap mx-auto">
				 <div className="container">
					 <div className="mediaHeadflex flex-row justify-between items-center mx-auto">
						 <div className="flex flex-row items-center">
							 <img src={Foto} alt="Weather Connect Logo" className="w-10 h-10 mr-2" />
							 <div className="text-gradient">
								 <span className="text-2xl font-bold text-slate-700 tracking-tighter">Weather Connect</span>
							 </div>
						 </div>
						 <div className="flex flex-row items-center lg:hidden">
							 <button onClick={toggleMenu} className="text-slate800 hover:text-slate-500 focus:outline-none">
								 <svg viewBox="0 0 20 20" fill="currentColor" className="w-6 h-6">
									 <path
									  fillRule="evenodd"
									  d="M3 5a1 1 0 011-1h12a1 1 0 010 2H4a1 1 0 01-1-1zm0 5a1 1 0 011-1h12a1 1 0 010 2H4a1 1 0 01-1-1zm0 5a1 1 0 100 2h12a1 1 0 100-2H4z"
									  clipRule="evenodd"
									 />
								 </svg>
							 </button>
						 </div>
						 <ul
						  className={`font-semibold flex flex-col lg:flex-row lg:space-x-8 lg:mt-0 ${
						   isMenuOpen ? 'block' : 'hidden'
						  } lg:flex`}
						 >
							 <li>
								 <NavLink
								  to="/home"
								  activeClassName="text-slate-500"
								  className={`text-slate800 hover:text-slate-500 ${
								   isNavLinkActive('/home') ? 'text-gradient font-extrabold' : ''
								  }`}
								 >
									 Home
								 </NavLink>
							 </li>
							 <li>
								 <NavLink
								  to="/clima"
								  activeClassName="text-slate-500"
								  className={`text-slate800 hover:text-slate-500 ${
								   isNavLinkActive('/clima') ? 'text-gradient font-extrabold' : ''
								  }`}
								 >
									 Clima
								 </NavLink>
							 </li>
							 <li>
								 <NavLink
								  to="/astronomia"
								  activeClassName="text-slate-500"
								  className={`text-slate800 hover:text-slate-500 ${
								   isNavLinkActive('/astronomia') ? 'text-gradient font-extrabold' : ''
								  }`}
								 >
									 Astronomia
								 </NavLink>
							 </li>
							 <li>
								 <NavLink
								  to="/sol"
								  activeClassName="text-slate-500"
								  className={`text-slate800 hover:text-slate-500 ${
								   isNavLinkActive('/sol') ? 'text-gradient font-extrabold' : ''
								  }`}
								 >
									 Sol
								 </NavLink>
							 </li>
							 <li>
								 <NavLink
								  to="/mares"
								  activeClassName="text-slate-500"
								  className={`text-slate800 hover:text-slate-500 ${
								   isNavLinkActive('/mares') ? 'text-gradient font-extrabold' : ''
								  }`}
								 >
									 Mar√©s
								 </NavLink>
							 </li>
							 <li className="flex items-center">
								 <a
								  href="https://github.com/GabrielAm0/WeatherConnect"
								  target="_blank"
								  className="ml-1 block text-slate800 hover:text-slate-500"
								 >
									 <span className="sr-only">Tailwind CSS on GitHub</span>
									 <svg viewBox="0 0 16 16" className="w-5 h-5" fill="currentColor" aria-hidden="true">
										 <path
										  d="M8 0C3.58 0 0 3.58 0 8c0 3.54 2.29 6.53 5.47 7.59.4.07.55-.17.55-.38 0-.19-.01-.82-.01-1.49-2.01.37-2.53-.49-2.69-.94-.09-.23-.48-.94-.82-1.13-.28-.15-.68-.52-.01-.53.63-.01 1.08.58 1.23.82.72 1.21 1.87.87 2.33.66.07-.52.28-.87.51-1.07-1.78-.2-3.64-.89-3.64-3.95 0-.87.31-1.59.82-2.15-.08-.2-.36-1.02.08-2.12 0 0 .67-.21 2.2.82.64-.18 1.32-.27 2-.27.68 0 1.36.09 2 .27 1.53-1.04 2.2-.82 2.2-.82.44 1.1.16 1.92.08 2.12.51.56.82 1.27.82 2.15 0 3.07-1.87 3.75-3.65 3.95.29.25.54.73.54 1.48 0 1.07-.01 1.93-.01 2.2 0 .21.15.46.55.38A8.013 8.013 0 0016 8c0-4.42-3.58-8-8-8z"
										 ></path>
									 </svg>
								 </a>
							 </li>
						 </ul>
					 </div>
				 </div>
			 </div>
		 </nav>
	 </header>
	);
}

export default Header;
